int arr[10]; // тип имя[размер] - массив размером в
// 10 элементов, без явной инициализации
// и, следовательно, с неизвестными
// значениями элементов

double arr[3] = { 3.14159, 0., 7,2 };
// тип имя[размер] = { ... } массив размером в
// 3 элемента с явной инициализацией
// всех элементов через список инициализации

char arr[5] = { 10, 'a', 'e' };
// тип имя[размер] = { ... } массив размером в
// 5 элементов с явной частичной инициализацией
// трех элементов через список инициализации, где
// все оставшиеся элементы с неизвестными значениями

int arr[] = { 5, 4, 1, 2 };
// тип имя[] = { ... } массив размером в 4 элемента
// с неявным выводом размера массива через список
// инициализации

int arr[25] = { 0 };
// тип имя[размер] = { 0 } массив размером в 25
// элементов с явной инициализацией всех элементов
// нулем
